import React from 'react';
import '../C_login/style_login.css';
import AUlogo from '../C_login/AUlogo.png';
function EmailLogin() {
  
    return (    
      <div class="login_logo"> 
        <img src={AUlogo} className="AU-logo" alt="logo" />
      </div>
    );
  }
  
  export default EmailLogin;
